    const {loggedUser,setLoggedUser}=useContext(AuthContext)
    useEffect(() => {
        axios
          .get("/me")
          .then((res) => res.data)
          .then((user) => {
            setLoggedUser(user)

          });
      }, []);

      console.log(loggedUser);
    return(
    <div>
        <Search/>
        <Content/>
        <Pages/>

    </div>)
}

export default Body
